import React, { Fragment } from "react";
import { Card, Row, Col } from "antd";

const ReservationList = ({ data }) => {
  return (
    <Fragment>
      {data.map(reserv => (
        <Card key={reserv.id} title={`Table: ${reserv.table_number}`}></Card>
      ))}
    </Fragment>
  );
};

export default ReservationList;
